    false,nt"url": null,nt"notes": "The Coastal and Marine Geology Program
    of the U.S. Geological Survey has generated a comprehensive data clearinghouse of
    digital vector shorelines and shoreline change rates for the sandy shoreline along
    the California open coast. These data, which are presented herein, were compiled
    as part of the U.S. Geological Survey's National Assessment of Shoreline Change
    Project. The GIS data layers from this publication are cataloged below by region
    for easy access. Please refer to http://woodshole.er.usgs.gov/project-pages/dsas/
    for information about the Digital Shoreline Analysis System (DSAS) used for the
    analysis of this data.",nt"license_title": null,nt"extras": [{ntt"key":
